  const sidebar = (
    <ul>
      {props.posts.map((post) =>
        <li key={post.code}>
          {post.name}
        </li>
      )}
    </ul>
  );
  const content = props.posts.map((post) =>
    <div key={post.code}>
      <h3>{post.name}</h3>
      <p>{post.cost}</p>
    </div>
  );
  return (
    <div>
      {sidebar}
      <hr />
      {content}
    </div>
  );
}

